import React from 'react';
import defaultMap from '../../worldpin_canvas_map.png';

const CanvasMap = (props = null) => {
  return (
    <div className="canvas-map" style={{backgroundImage: props.url || defaultMap}}>
      "test 123"
    </div>
  )
}

export default CanvasMap;
